const {VertexAI} = require('@google-cloud/vertexai');

// Initialize Vertex with your Cloud project and location
const vertex_ai = new VertexAI({project: 'scenic-hydra-410305', location: 'us-central1'});
const model = 'gemini-pro-vision';

// Instantiate the models
const generativeModel = vertex_ai.preview.getGenerativeModel({
  model: model,
  generation_config: {
    "max_output_tokens": 2048,
    "temperature": 0.4,
    "top_p": 1,
    "top_k": 32
},
});

async function generateContent() {
  const req = {
    contents: [{role: 'user', parts: [{inline_data: {mime_type: 'image/png', data: ''}}, {text: "I need a terraform script for gcp with the architecture diagram mentioned above."}]}],
  };

  const streamingResp = await generativeModel.generateContentStream(req);

  for await (const item of streamingResp.stream) {
    process.stdout.write('stream chunk: ' + item);
  }

  process.stdout.write('aggregated response: ' + (await streamingResp.response));
};

generateContent();